    <div className="max-w-md mx-auto mt-10 p-6 bg-white rounded-2xl shadow-md text-center">
      <h2 className="text-2xl font-bold text-center">Capital Actual</h2>
      {capital ? (
      <p className="text-xl text-green-600 font-semibold">${capital.monto}</p>
    ) : (
      <p className="text-gray-500">Cargando...</p>
